window.bookSummaryJSON = "<p><b>Ryker</b></p> <p>When Ellery walked out of my life, I never wanted to see her again. Now she's back and desperate for my help.</p> <p>I didn't believe it was possible to hate her even more… <i>until she proves me wrong.</i></p> <p><b>Ellery</b></p> <p>I'll do whatever it takes to rescue my mother from the monsters imprisoning her, including turning to the man who despises me most.</p> <p>Will Ryker help me, or will I have to reveal my secrets to the merciless king and trap myself forever to gain her freedom?</p> <p><b>Return to the Shadow Realms. A world where immortals unleash lightning, dark fae seduce, witches cast their spells, dragons rule the skies… and the legend of Robin Hood comes alive in a new way.</b></p> <p><i>***The Tempest Series is a spinoff of the Shadow Realms series. You do not have to listen to the Shadow Realms series to follow this one.***</i></p>"; 
